import { useState } from "react";
import getProductByBarcode from "../helpers/getProductByBarcode";


const Buy = () => {

    const [barcodeChecked, setBarcodeChecked] = useState(true);

    return (
       <div className="mt-10 mb-2">
          <div className="flex flex-row-reverse justify-center">
             <input
                type="text"
                className="border ms-1 focus:outline-2 focus:outline-yellow-300"
             />
             <label>
                بالباركود
                <input type="radio" checked={barcodeChecked} />
             </label>
             <label>
                بالإسم
                <input type="radio" />
             </label>
             <button
                type="button"
                className="bg-main-color px-3 py-2 font-bold rounded-md"
             >
                ابحث
             </button>
          </div>
       </div>
    );
}

export default Buy;
